function importData(){
	var txt = prompt("Please enter the code that you have copied previously:")
	
	if(!txt){
		if(txt==""){
			alert("Please enter a valid code.")
		}
		return false
	}else{
	
	if(txt.slice(0,1)!="{"&&txt.slice((txt.length-1),txt.length)!="}"){
		alert("Not a valid code.\nPlease make sure you copy the whole code.\n\n (not vaild)")
		return false
	}

	var data = JSON.parse(txt),
	    ver = ""; 

	for (var key in data) { 
		if(key=="version"){
			ver=data.version;
		}
	}
	if(ver==""){
		alert("Not a valid code.\nPlease make sure you copy the whole code.\n\n (version missing)")
		return false
	}else if(ver!=localStorage["version"]){
		if(!confirm("The entered code does not have the same version as the current one.\nDo you want to continue?")){
			return false
		}
	}
	
	for (var key in data) { 
		localStorage[key] = data[key];
	}
	alert("Done, please restart your browser.")
	}
}


function resetData(){
	if(!confirm("Confirm? You can not undo this after reseting.")){
		return false
	}
	resetDataProcess()
	chrome.extension.getBackgroundPage().location.href="background.html";
	alert("Reseted.\nIt will now re-install this extension...")
	window.close()
}
function resetDataProcess(){
	for(i=0;i<localStorage.length;i++){
		localStorage.removeItem(localStorage.key(i))
	}

	var nnm=false
	for(i=0;i<localStorage.length;i++){
		nnm=true
	}

	if(nnm==true){resetDataProcess()}

}


