function fileapi(files,noti){
ele=document.getElementById(((noti=='noti')?"noti_drag":"drag"))
   for (var i = 0, file; file = files[i]; i++) {
    var reader = new FileReader(); 
if (file.type.match('audio.mp3')||file.type.match('audio.ogg')||file.type.match('audio.wav')) {  
    ele.innerHTML="Processing..."
    if(noti!='noti'){
    reader.onloadend = handleReaderLoadEnd
    }else{
    reader.onloadend = noti_handleReaderLoadEnd
    }
    reader.readAsDataURL(file);  
      continue;
    }  else  {  
    alert("Only accept .mp3 ,.ogg or .wav files.")
      continue;
    }
//do nothing
}
}

function handleReaderLoadEnd(evt){
  var decision="none"
  try{
    alert("Length: "+evt.target.result.length)
    var result=evt.target.result
    if(result.length>(2286976+22)){
      if(confirm("The file is too big to save in local storage.\nDo you want to save it in the Web SQL Database?\n(Database has more space than local storage.)\n\nReminder: Using files that're very big is not recommended. Files too big might take a few seconds to load.")){
        //Save it in Web SQL Database
        setTimeout(function(){
          var db = window.openDatabase('DB', '1.0', 'Settings database', 5 * 1024 * 1024);
  
          db.transaction(function (tx) {
            tx.executeSql('CREATE TABLE IF NOT EXISTS data (key,data,timestamp)');
            tx.executeSql('DELETE FROM data WHERE key="ringtone"');
            tx.executeSql('INSERT INTO data VALUES ("ringtone","'+result+'",'+Number(new Date())+')',[],function(tx,results){console.log("Successfully stored file in Database!")});
          })
        },10)
        localStorage["ringtone"]="database"
        decision="db"
      }else{
        if(confirm("The file is too big for local storage. ("+result.length+" characters long)\nDo you want to cut it into a smaller sound clip?")){
          //result=result.slice(0,(22+262400))
          //!!!BASE64, must be 64 times a number!!!
          result=result.slice(0,(2286976+22))
          //result=result.slice(0,(4573952+22))
          decision="slice"
        }
      }
    }

    //Store ringtone!
    if(decision!="db"){
      localStorage["ringtone"]=result
    }

    //---------

  }catch(err){
    showerror(err,evt.target.result.length)
    document.getElementById("drag").innerHTML="An error has occured. :("
    setTimeout(function(){document.getElementById("drag").innerText="Or drop file here..."},2000)
    return false
  }
  document.getElementById("lo_ring").checked=true
  document.getElementById("drag").innerHTML="Done!"
  setTimeout(function(){document.getElementById("drag").innerText="Or drop file here..."},1000)
  save()
}

function noti_handleReaderLoadEnd(evt){
	try{
		localStorage["noti_sound"] = evt.target.result
	}
	catch(err){
		showerror(err,evt.target.result.length);
		document.getElementById("noti_drag").innerHTML="An error has occured. :(";
		setTimeout(function(){document.getElementById("noti_drag").innerText="no drag and drop file here, sorry :("},2000)
		return false;
	}
	document.getElementById("notisound_local").checked = true;
	document.getElementById("noti_drag").innerHTML = "Done!";
	setTimeout(function(){document.getElementById("noti_drag").innerText="no drag and drop file here, sorry :("},1000)
	save();
}

function showerror(err,other){
  var txt=""
  if(err.message=="QUOTA_EXCEEDED_ERR: DOM Exception 22"){
    txt="The selected file is too large. Please select a smaller file.\nBest within 2 minutes of the length.\n\nFor MP3, 1.87MB max.\n\n(Choosed file's length in dataURI: "+other+" bits)"
  }

  alert("An error has occured!\n\n"+txt+"\n\nOriginal message:\n"+err.message)
}



